description:
BRS Gross Anatomy presents a concise review of human anatomy for students in medical, dental, graduate, physician assistant, physical therapy, and other health science programs. Condensed descriptions, full-color illustrations, and concise outline format combine with board-style questions and a comprehensive exam at the end of the book for a comprehensive, clinically relevant review for USMLE and other board exams in health-related professions. Although in summary form, coverage is similar to standard textbooks for human anatomy courses.
Publication date: May 27, 2011


